```javascript
function extractCSSRules(cssCode, selectors) {
  // Initialize an object to store the extracted CSS rules
  const extractedCSS = {};

  // Iterate through each selector
  for (const selector of selectors) {
    // Find the opening curly brace after the selector
    let startIndex = cssCode.indexOf(selector + " {");

    if (startIndex !== -1) {
      // Move past the selector and open curly brace
      startIndex += selector.length + 2;

      // Find the closing curly brace after the rules
      let endIndex = cssCode.indexOf("}", startIndex);

