        // Move past the closing curly brace to handle multiple selectors in a single rule
        startIndex = endIndex + 1;
      } else {
        extractedCSS[selector] = "";
      }
    } else {
      extractedCSS[selector] = "";
    }
  }

  return extractedCSS;
}
```

