            int sizeZ = Math.Min(arr1.GetLength(2), Math.Min(arr2.GetLength(2), arr3.GetLength(2)));

            double[, ,] dotProduct = new double[sizeX, sizeY, sizeZ];

            for (int i = 0; i < sizeX; i++) {
                for (int j = 0; j < sizeY; j++) {
                    for (int k = 0; k < sizeZ; k++) {
                        dotProduct[i, j, k] = arr1[i, j, k] * arr2[i, j, k] * arr3[i, j, k];
                    }
