def enhanced_char_count(s):
    # Initialize variables to store counts and frequency data
    vowels = {}
    consonants = {}
    digits = {}
    special_chars = {}

    for char in s:
        if char.isalpha():
            if char.lower() in 'aeiou':
                # Update vowel counts and frequency data
                if char.lower() in vowels:
                    vowels[char.lower()] += 1
                else:
                    vowels[char.lower()] = 1
            else:
                # Update consonant counts and frequency data
                if char.lower() in consonants:
                    consonants[char.lower()] += 1
                else:
                    consonants[char.lower()] = 1
        elif char.isdigit():
            # Update digit counts and frequency data
            if char in digits:
                digits[char] += 1
            else:
                digits[char] = 1
        else:
            # Update special character counts and frequency data
            if char in special_chars:
                special_chars[char] += 1
            else:
                special_chars[char] = 1

    # Calculate the highest and lowest frequency characters
    vowel_freqs = list(vowels.values())
    consonant_freqs = list(consonants.values())
    highest_frequency = max([*vowel_freqs, *consonant_freqs])
    lowest_frequency = min([*vowel_freqs, *consonant_freqs])

    # Filter out characters with the highest and lowest frequencies
    highest_freq_chars = {}
    lowest_freq_chars = {}
    for char, freq in {**vowels, **consonants}.items():
        if freq == highest_frequency:
            highest_freq_chars[char] = freq
        elif freq == lowest_frequency:
            lowest_freq_chars[char] = freq

    # Return the dictionary with all counts and frequency data
    return {
        "Letters": {"Vowels": vowels, "Consonants": consonants},
        "Digits": digits,
        "Special characters": len(special_chars),
        "Highest frequency": highest_freq_chars,
