1. Since we are dealing with large lists, it's important to make sure our solution is efficient and does not have any unnecessary complexity. We can use a sieve algorithm to find all the prime numbers in the input list in O(nloglogn) time. This will help us efficiently determine which elements are prime or not.
2. Next, we can iterate through the input list again and for each element:
	* If it is prime, we subtract the current element's value from the sum of all primes (excluding the current one).
	* If it is not prime, we subtract the current element's value from the sum of all elements in the list.
3. Finally, append the resulting sum to our output list for each iteration.

Here is a possible implementation of this approach:
```
def calculate_sums(arr):
    n = len(arr)  # Number of elements in the input list
    is_prime = [True] * (n + 1)  # Initialize all numbers to be prime
    sum_of_primes = 0  # Keep track of the sum of primes
    sum_of_all_elements = sum(arr)  # Calculate the initial sum of all elements in the list

    for i in range(2, int(n**0.5) + 1):
        if is_prime[i]:
            for j in range(i * i, n + 1, i):
                is_prime[j] = False

    for i in range(2, n + 1):
        if is_prime[i]:
            sum_of_primes += arr[i - 2]  # Add the prime number to the sum of primes

    result = []
    for i in range(n):
        current_element = arr[i]
        if is_prime[current_element]:
            result.append(sum_of_primes - current_element)  # Subtract the prime number from the sum of primes
        else:
            result.append(sum_of_all_elements - current_element)  # Subtract the non-prime element from the sum of all elements

    return result
```
This approach has a time complexity of O(nloglogn) since we are using a sieve algorithm to find primes. Space complexity is O(n).

