1) Centering elements with CSS Grid
CSS Grid allows you to easily center your elements both vertically and horizontally without the need for Flexbox or absolute positioning. You can use `grid-template-areas` to define a layout, and then place each element in its appropriate area. Here's an example:
```css
.container {
  display: grid;
  grid-template-columns: 1fr 200px 1fr;
  grid-template-rows: 50% 50%;
  grid-gap: 30px;
  grid-template-areas: " . logo ." " . content .";
}
.logo {
  grid-area: logo;
}
.content {
  grid-area: content;
}
```
With this code, the logo and content elements are centered in their respective areas.
2) Responsive design
To ensure that your website is responsive to different screen sizes, you can use media queries to adjust your layout based on viewport width. Here's an example:
```css
@media (max-width: 768px) {
    .container {
        display: grid;
        grid-template-columns: 100%;
        grid-gap: 20px;
        grid-template-areas: "logo" "content";
    }
}
```
This media query will apply when the viewport width is less than or equal to 768px. It changes the layout to display logo and content in separate rows, which makes it easier for users to access the content on smaller screens.
